// make sure user decides if they want to add name to the project or not

const Project = ({navigate}) => {
    const project = window.localStorage.getItem("project") // this is response.data
    const projectStr = JSON.stringify(project["description"])
    return (
        <div>
            <h1>
                PROJECT PAGE
            </h1>
            <p>
                {project}
                {projectStr}
            </p>
        </div>
    )
} 

export default Project
